import React, { useEffect, useState } from 'react';
import { Layout, Spin, Alert, Row, Col } from 'antd';
import Dashboard from './components/Dashboard';
import MemberProfileCard from './components/MemberProfileCard';
import MemberJourney from './components/MemberJourney';
import { eventAPI } from './services/api';

const { Header, Content, Footer } = Layout;

const App = () => {
  const [loading, setLoading] = useState(true);
  const [profile, setProfile] = useState(null);
  const [journey, setJourney] = useState([]);
  const [error, setError] = useState(null);

  useEffect(() => {
    loadAppData();
  }, []);

  const loadAppData = async () => {
    try {
      setLoading(true);
      const [profileRes, journeyRes] = await Promise.all([
        eventAPI.getMemberProfile(),
        eventAPI.getJourney(),
      ]);
      setProfile(profileRes.data);
      setJourney(journeyRes.data);
    } catch (err) {
      setError('Failed to load member data');
      console.error(err);
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <Spin size="large" style={{ display: 'flex', justifyContent: 'center', marginTop: '100px' }} />
    );
  }

  if (error) {
    return <Alert message={error} type="error" />;
  }

  return (
    <Layout style={{ minHeight: '100vh' }}>
      <Header style={{ background: '#001529', color: '#fff' }}>
        <h1 style={{ color: 'white' }}>Elyx Life – Member Dashboard</h1>
      </Header>
      <Content style={{ padding: '24px' }}>
        <Row gutter={[16, 16]}>
          <Col span={8}>
            {profile && <MemberProfileCard profile={profile} />}
          </Col>
          <Col span={16}>
            <Dashboard />
          </Col>
        </Row>
        <Row style={{ marginTop: '24px' }}>
          <Col span={24}>
            <MemberJourney journey={journey} />
          </Col>
        </Row>
      </Content>
      <Footer style={{ textAlign: 'center' }}>
        Elyx Life © {new Date().getFullYear()} | Hackathon Prototype
      </Footer>
    </Layout>
  );
};

export default App;
